#include <iostream>
#include <vector>
#include <ctime>
using namespace std;

class Solution {
public:
    string shortestPalindrome(string s) {
        if (s.size() == 0 || s.size() == 1) {
            return s;
        }
        string re_s = s;
        reverse(re_s.begin(), re_s.end());
        string c = s + '?' + re_s;

        /* Core of KMP prefix function */
        /* Idea is to find the longest suffix matches prefix */
        /*****************************************************/
        string::size_type j = 0;
        vector<string::size_type> prefix(c.size(), 0);
        for (string::size_type i = 1; i < c.size(); ++i) {
            while (j > 0 && c[j] != c[i]) {
                j = prefix[j-1];
            }

            if (c[j] == c[i]) {
                ++j;
            }
            prefix[i] = j;
        }
        /*****************************************************/

        return re_s.substr(0,s.size()-prefix[prefix.size()-1]) + s;
    }
};
int main() {
    clock_t start = clock();
    cout << Solution().shortestPalindrome("");
    clock_t end = clock();
    cout << "Time used: " << end - start << endl;
    return 0;
}
